import axios from 'axios';
import { apiEndpoint } from './apiConfig';

export async function getMove(board, player) {
    move = -1
    await axios.get(`${apiEndpoint}/getMove`, {
      data: {
        board: board,
        player: player
      }
    }).then((response) => {
      move = response.data
    })
}
